import React from "react";
import SearchRoot from "./pages/search-root";
import { Link, Route, Switch } from 'react-router-dom';
import "./styles/main.css";
import * as logo from './images/tidesandtravels1.png'

// Root component
const App = () => {
  return (
    <>


      <div class="nav">
        <img src={logo} alt="logo" draggable={false} />
        <div class="links">
          {/* <a class="link link-selected" href="#">Home</a> */}
          {/* <a class="link" href="#">Why Tides&Travels</a> */}
          {/* <a class="link" href="#">About Us</a> */}
          {/* <a class="link" href="#">Services</a> */}
          {/* <a class="link" href="#">Contact Us</a> */}


          <Link to="/">Home</Link>
          <Link to="/about">Why Tides&Travels</Link>
          <Link to="/groups">GROUPS & EVENTS</Link>
          <Link to="/land">LAND LOVERS</Link>
          <Link to="/extras">EXTRAS</Link>
          <Link to="/booked">ALREADY BOOKED</Link>


          <Switch>
            <Route exact path="/">
              <Home />
            </Route>

            <Route path="/about">
              <About />
            </Route>
            <Route exact path="/Products">
              <Products />
            </Route>
            <Route path="/product/:productId">
              <ProductDetail />
            </Route>
          </Switch>





















        </div>
      </div>


      <SearchRoot />
    </>
  );
};

export default App;
